#define BusClock 80000000
#define SampleFreq 11025
soundeffect sound2play; // global variable that tells which sound to play
typedef struct { 
   const unsigned char *wave; //a pointer to the sound samples array
   uint32_t length;     // how long the array is
} sound_t;

sound_t sounds[6] ={
	{shootWav, shootLen},
	{playerDieWav, playerDieLen,},
	{thrustWav, thrustLen},
	{scoreTableWav, scoreTableLen},
	{laserWav,laserLen},
	{defenderStartWav, defenderStartLen}
};

void Sound_Init(void){
	DAC_Init();
	
};

uint32_t pIndex=0;
void playsample(){
   DAC_Out(sounds[sound2play].wave[pIndex++]);
   if (pIndex >= sounds[sound2play].length){
     Timer0A_Stop();
     pIndex=0;
   }
}


void playsound(soundeffect sound){
  sound2play = sound;
	Timer0_Init(&playsample, BusClock/SampleFreq); // 11.025 kHz
}







